import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import AppNavBar from './components/AppNavBar';
import Main from './components/Main';

function App() {
  return (
    <div className="App">
      <AppNavBar/>
      <Main/>
    </div>
  );
}

export default App;
